import React from 'react';
import Panel from './Panel';


const PanelList = ({ pokedex }) => {
    const PanelCompon = pokedex.map((pokemon, i) => {
        let pane = <Panel id={pokedex[i].id} name={pokedex[i].name} types={pokedex[i].types}/>
        return pane.sort(function(a, b){return a-b});
    })
    return (
        <div>
            {PanelCompon}
        </div>
    );
}

export default PanelList;
